import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>My TV Shows</h1>

      </header>
      <input className="search" placeholder="Type to filter..." type="text"/>

      <div>
        <img src="http://static.tvmaze.com/uploads/images/medium_portrait/81/202627.jpg" alt="test"></img>

      </div>
    </div>
  );
}

export default App;
